import todoInfo from "../models/todoItem";

function TodoItem(props: { todoItem: todoInfo }) {
    console.log(props.todoItem);

    return (
        <div className="w-lvw	 flex items-center bg-slate-300 m-2 p-2">
            <input type="checkbox" className="w-6 h-6 checked:bg-blue-500 p-0 m-0" checked={props.todoItem.isCompleted} />
            <div className="w-full flex flex-col m-2 items-center bg-slate-500">
                <h2 className="text-3xl bg-slate-400 w-full flex justify-center">{props.todoItem.title}</h2>
                <h4 className="text-2xl">{props.todoItem.description}</h4>
            </div>
        </div>
    );
}

export default TodoItem;
